DROP TABLE IF EXISTS `facilitys`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `facilitys` (
  `id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `facilitycode` int(10) DEFAULT '0' COMMENT 'Facility Name',
  `district` varchar(30) DEFAULT NULL COMMENT 'Facility District Name',
  `name` varchar(50) DEFAULT NULL COMMENT 'Facility Name',
  `lab` int(14) DEFAULT NULL,
  `ftype` varchar(200) DEFAULT NULL,
  `longitude` varchar(200) DEFAULT NULL,
  `latitude` varchar(200) DEFAULT NULL,
  `telephone` varchar(20) DEFAULT NULL COMMENT 'Facility Telephone 1',
  `telephone2` varchar(20) DEFAULT NULL COMMENT 'Facility Telephone 2',
  `telephone3` varchar(20) DEFAULT NULL COMMENT 'Facility Telephone 2',
  `fax` varchar(30) DEFAULT NULL,
  `email` varchar(100) DEFAULT NULL COMMENT 'Facility email Address',
  `PostalAddress` varchar(40) DEFAULT NULL COMMENT 'Facility Contact Address',
  `contactperson` varchar(30) DEFAULT NULL COMMENT 'Facility Contact Name',
  `contacttelephone` varchar(20) DEFAULT NULL COMMENT 'Contact Person''s Telephone 1',
  `contacttelephone2` varchar(20) DEFAULT NULL COMMENT 'Contact Person''s Telephone 2',
  `contacttelephone3` varchar(20) DEFAULT NULL COMMENT 'Contact Person''s Telephone 2',
  `physicaladdress` varchar(40) DEFAULT NULL COMMENT 'Facility Physical Address',
  `ContactEmail` varchar(100) DEFAULT NULL COMMENT 'Facility Physical Address',
  `ContactEmail2` varchar(100) DEFAULT NULL COMMENT 'Facility Physical Address',
  `ContactEmail3` varchar(100) DEFAULT NULL COMMENT 'Facility Physical Address',
  `ContactEmail4` varchar(100) DEFAULT NULL COMMENT 'Facility Physical Address',
  `ContactEmail5` varchar(100) DEFAULT NULL COMMENT 'Facility Physical Address',
  `ContactEmail6` varchar(100) DEFAULT NULL COMMENT 'Facility Physical Address',
  `Flag` int(11) DEFAULT '1',
  `partner` int(14) DEFAULT '0',
  `synched` int(14) DEFAULT '0',
  `ANC` varchar(10) DEFAULT NULL,
  `PMTCT` varchar(10) DEFAULT NULL,
  `serviceprovider` varchar(32) DEFAULT NULL,
  `smsprinterphoneno` varchar(32) DEFAULT NULL,
  `smsprimarycontact` varchar(50) DEFAULT NULL,
  `smssecondarycontact` varchar(50) DEFAULT NULL,
  `smscontactperson` varchar(50) DEFAULT NULL,
  `smsprinter` int(14) DEFAULT '0',
  `G4Sbranchname` varchar(100) DEFAULT NULL,
  `G4Slocation` varchar(100) DEFAULT NULL,
  `G4Sphone1` varchar(100) DEFAULT NULL,
  `G4Sphone2` varchar(100) DEFAULT NULL,
  `G4Sphone3` varchar(100) DEFAULT NULL,
  `G4Sfax` varchar(100) DEFAULT NULL,
  `dmltemail` varchar(100) DEFAULT NULL,
  `dtlcemail` varchar(100) DEFAULT NULL,
  `partnerlabmail` varchar(100) DEFAULT NULL,
  `partnerpointmail` varchar(100) DEFAULT NULL,
  `partneremail` varchar(100) DEFAULT NULL,
  `datemodified` varchar(100) DEFAULT NULL,
  `sent` int(100) DEFAULT '0',
  `sent2` int(100) DEFAULT '0',
  `sentmail` int(100) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `id` (`id`),
  KEY `lab` (`lab`,`district`),
  KEY `serviceprovider` (`serviceprovider`,`smsprinterphoneno`),
  KEY `facilitycode` (`facilitycode`),
  KEY `fax` (`fax`),
  KEY `email` (`email`),
  KEY `name` (`name`),
  KEY `ContactEmail` (`ContactEmail`),
  KEY `ContactEmail2` (`ContactEmail2`),
  KEY `Flag` (`Flag`),
  KEY `partner` (`partner`),
  KEY `smsprinter` (`smsprinter`),
  KEY `partnerlabmail` (`partnerlabmail`),
  KEY `partnerpointmail` (`partnerpointmail`),
  KEY `partneremail` (`partneremail`),
  KEY `dmltemail` (`dmltemail`),
  KEY `dtlcemail` (`dtlcemail`),
  KEY `ContactEmail3` (`ContactEmail3`),
  KEY `ContactEmail4` (`ContactEmail4`),
  KEY `ContactEmail5` (`ContactEmail5`),
  KEY `ContactEmail6` (`ContactEmail6`),
  KEY `sent` (`sent`),
  KEY `sentmail` (`sentmail`)
) ENGINE=InnoDB AUTO_INCREMENT=40003 DEFAULT CHARSET=latin1;
